import React from 'react';
import './DyTable.css';
import { Component } from 'react';

class DyTable extends Component  {
    constructor(props) {
        super(props);
    }



    render(){
        const res = this.props.input;

        return (
            <table className="tables">
            {
                res.split('\n').map((item)=>{

                    <td>{item }</td>
                })


            }
            </table>
        );
    }

}

export default DyTable;
